  [],\n\t\"revision_timestamp\": \"2016-02-26T22:15:55.248355\",\n\t\"name\": \"global-temperature-and-salinity-profile-programme-gtspp-data-53bf6\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Global Temperature-Salinity Profile
  Programme (GTSPP) develops and maintains a global ocean temperature and salinity
  resource with data that are both up-to-date and of the highest quality. It is a
  joint World Meteorological Organization (WMO) and Intergovernmental Oceanographic
  Commission (IOC) program.  It includes data from XBTs, CTDs, moored and drifting
  buoys, and PALACE floats. For information about organizations contributing data
  to GTSPP, see http://gosic.org/goos/GTSPP-data-flow.htm .  The U.S. National Oceanographic
  Data Center (NODC) maintains the GTSPP Continuously Managed Data Base and releases
  new 'best-copy' data once per month.WARNING: This dataset has a *lot* of data.  If
  you request too much data, your request will fail.* If you don't specify a longitude
  and latitude bounding box, don't request more than a month's data at a time.* If
  you do specify a longitude and latitude bounding box, you can request data for a
  proportionally longer time period.Requesting data for a specific station_id may
  be slow, but it works.*** This ERDDAP dataset has data for the entire world for
  all available times (currently, up to and including the July 2015 data) but is a
  subset of the original NODC 'best-copy' data.  It only includes data where the quality
  flags indicate the data is 1=CORRECT, 2=PROBABLY GOOD, or 5=MODIFIED. It does not
  include some of the metadata, any of the history data, or any of the quality flag
  data of the original dataset. You can always get the complete, up-to-date dataset
  (and additional, near-real-time data) from the source: http://www.nodc.noaa.gov/GTSPP/
  .  Specific differences are:* Profiles with a position_quality_flag or a time_quality_flag
  other than 1|2|5 were removed.* Rows with a depth (z) value less than -0.4 or greater
  than 10000 or a z_variable_quality_flag other than 1|2|5 were removed.* Temperature
  values less than -4 or greater than 40 or with a temperature_quality_flag other
  than 1|2|5 were set to NaN.* Salinity values less than 0 or greater than 41 or with
  a salinity_quality_flag other than 1|2|5 were set to NaN.* Time values were converted
  from \"days since 1900-01-01 00:00:00\" to \"seconds since 1970-01-01T00:00:00\".See
  the Quality Flag definitions on page 5 and \"Table 2.1: Global Impossible Parameter
  Values\" on page 61 ofhttp://www.nodc.noaa.gov/GTSPP/document/qcmans/GTSPP_RT_QC_Manual_20090916.pdf
  .The Quality Flag definitions are also athttp://www.nodc.noaa.gov/GTSPP/document/qcmans/qcflags.htm
